import React from 'react'
import ReactDOM from 'react-dom'

function Coin(){
    return (
        <>
        <CoinImage/>
        <CoinInfo/>
        </>
    );
}
function CoinImage(){
    return (
        <img src="../public/BitcoinImg.png" alt="Img not Available">
        </img>
    );
}

function CoinInfo(){
    return (
        <section>
            <CoinName/> 
            <CoinPriceInfo/>
        </section>
    );
}

function CoinName(){
    return (
        <>
        <h3>Bitcoin</h3>
        </>
    );
}

function CoinPriceInfo(){
    return (
        <>
        <h3>$25,000/-</h3>
        </>
    );
}

const CoinList=()=>{
    return (
        <>
        <section>
            <Coin/>
        </section>
        </>
    );

}

ReactDOM.render(
    <>
    <CoinList/>
    </>
    ,document.getElementById('root'));
